以下のカラーが完売となっております。<br>ヤシ ブルー/ヤシ ダークブルー<br>大変申し訳ありませんが、上記以外の色をご購入お願い致します。<br><br>

<table width="300" border="0" cellpadding="1" cellspacing="0" bgcolor="#FF9900">
<tr><td><strong><font color="#FFFFFF">★商品説明</font></strong></td>
</tr><tr><td><table width="100%" border="0" cellspacing="7" cellpadding="0" bgcolor="#FFFFFF">
<tr>
<td>・表面のカバーで液晶画面をキズから守り、バックの中での誤発信を防止します。<br>
  <br>・開閉はマグネットでとてもスムーズです。<br>
  <br>・内側にカードポケット1コ、写真入れ1コ、ロングポケット１コがついています。<br>
  <br>・iPhone6/6sとiPhone7でカメラ穴が異なりますので、お間違いのないよう機種のご選択をお願いします。<br>
  <br>※素材<br>
    手帳部分：デニム<br>
    装着ケース部分：ポリカーボネート<br>
  <br>・内側の装着ケースの色は基本的にはクリアです。<br>
    ハードケースは予告なく変更になる場合がございます。<br>
  <br>※カメラ穴は通常の撮影時は問題なく使用できますがフラッシュを使用した場合ケースのお色が写り込む場合がございます。<br>
    フラッシュをご使用の際にはケースを外してご使用いただけますようお願いいたします。 <br>
  <br>※商品のお色はお客様のPC環境によって多少色合い、見え方など違ってまいりますのでご了承下さいますようお願いします。<br>
  <br>※純正のUSBは使用可能です。マグネット充電は対応していません。置くだけ充電には対応しています。<br>
  <br>※この商品はメール便での発送となります。ポスト投函です。（ゆうパケット）<br>
  ・配送中の紛失・破損の保証はありません。<br>
  ・代引不可<br>
  ・配送の日時指定不可<br>
  ・ロッカー受取不可<br>
  <br> 
  ※配送保証のある宅配便に変更の場合は備考欄に「宅配便希望」と明記して下さい。<br>
  （有料　本州：500円、北海道・沖縄1,000円）<br>
  （誤送や盗難の可能性のある集合ポストなどの場合はご利用下さい）<br>
  自動配信メールでは送料・配送方法が修正されません。ショップからの受付メールで宅配便に変更し、送料を加算させて頂きます。</td>
</tr></table></td></tr></table>
